window.onload=function(){let e=document.getElementById("typewriter"),n=(new Typewriter(e,{loop:!0,strings:["Coding","Java","Gym","Wine & Beer","Arduino","Tennis","Soccer"],autoStart:!0}),new Date("July 08, 1984").getFullYear()),r=(new Date).getFullYear();$("#about-text").text(function(e,t){return t.replace("{{age}}",r-n)})};